import React from 'react';



function Blog(props) {
    const header = (
        <ul>
          {props.posts.map((post) =>
            <div className="col-2" key={post.id}>
              {post.title}
            </div>
          )}
        </ul>
      );
      const content = props.posts.map((post) =>
        <div className="rowData col-12" key={post.id}>
          <div className="col-2">
            <div>{post.title}</div>
          </div>
          <div className="col-2">
            <div>{post.dataOne}</div>
          </div>
          <div className="col-2">
            <div>{post.dataTwo}</div>
          </div>
          <div className="col-2">
            <div>{post.dataThree}</div>
          </div>
          <div className="col-2">
            <div>{post.dataFour}</div>
          </div>
        </div>
      );
    return (

              <div className="table row">
                <div className="Header col-12">
                    {header}
                </div>
                {content}
              </div>
            );
}

const posts = [
    {id: 1, title: 'Hello World', dataOne: 'Welcome to learning React!'},
    {id: 2, title: 'Installation', dataOne: 'You can install React from npm.'}
  ];
export default <Blog posts={posts} /> ;
